export const RECEIVE_USERS = 'RECEIVE_USERS'
export const SET_ANSWER = 'SET_ANSWER'

export function receiveUsers (users) {
  return {
    type: RECEIVE_USERS,
    users
  }
}

export function setAnswer (users) {
  return {
    type: SET_ANSWER,
    users
  }
}
